### frame_vector_destroy

#### Description

This function is responsible for destroying a frame vector. It checks if the vector has any frames and frees the memory allocated for the vector.

#### Parameters

*   `vec`: The frame vector to be destroyed.

#### Return Value

None. The function does not return any value.

#### Example

```c
// Create a frame vector
struct frame_vector vec;
vec.nr_frames = 5;
vec.frames = kmalloc(sizeof(struct frame), 5);

// Add frames to the vector
frame_vector_add(&vec, &frame1);
frame_vector_add(&vec, &frame2);
frame_vector_add(&vec, &frame3);
frame_vector_add(&vec, &frame4);
frame_vector_add(&vec, &frame5);

// Destroy the frame vector
frame_vector_destroy(&vec);
```

