 * of each element d positions to the right.
 *
 * @param n A pointer to a RNumBig array to be shifted.
 * @param d The number of positions to shift the bits.
 */
R_API void r_big_shift(RNumBig *n, int d) {
    BN_copy(&a, n);
    BN_lshift(n, a, d);
}
```

